*,
*::before,
*::after {
  margin: 0;
  padding: 0;
  box-sizing: inherit; }

html {
  box-sizing: border-box;
  font-size: 62.5%; }
  @media only screen and (max-width: 26.56em) {
    html {
      font-size: 50%; } }

body {
  box-sizing: border-box;
  display: grid;
  grid-template-rows: [header-start] 100vh [header-end skills-start] minmax(min-content, max-content) [skills-end project-start] minmax(min-content, max-content) [project-end bio-start] minmax(min-content, max-content) [bio-end contact-start] minmax(min-content, max-content) [contact-end footer-start] max-content [footer-end];
  overflow-x: hidden;
  overscroll-behavior-y: none;
  overscroll-behavior-x: none; }

::selection {
  background-color: #222d3a;
  color: #dfac5d; }

body {
  font-family: 'Nunito Sans', sans-serif;
  font-weight: 200;
  font-size: 1.6rem;
  line-height: 2.4rem; }

.curriculum__methodology__link:link, .curriculum__methodology__link:visited {
