  .btn--chart, .btn--curriculum {
    display: flex;
    cursor: pointer;
    border: none;
    align-self: center;
    padding: 1rem 7rem;
    border-radius: 5px;
    background-color: white;
    font-size: 1.2rem;
    color: #2a2a2a; }
    .btn--chart:hover, .btn--chart:active, .btn--chart:focus, .btn--curriculum:hover, .btn--curriculum:active, .btn--curriculum:focus {
      background-color: gainsboro; }

.fade-in {
  display: none; }

.fade-in.appear {
  transition: display 500ms ease-in; }

