.popup.active {
  opacity: 1;
  transform: translate(-50%, -50%) scale(1); }

.popup {
  height: 100vh;
  width: 100vw;
  top: 0;
  left: 0;
  position: fixed;
  z-index: 3000;
  background-color: rgba(42, 42, 42, 0.97);
  border-radius: 5px;
  transition: all .5s;
  opacity: 0;
  visibility: hidden;
  backdrop-filter: blur(10px);
  -webkit-backdrop-filter: blur(10px); }
  .popup:target {
    opacity: 1;
    visibility: visible; }
  .popup:target .popup__content {
    opacity: 1;
    transform: translate(-50%, -50%) scale(1); }
  .popup__close:link, .popup__close:visited {
    height: 3rem;
    width: 3rem;
    position: absolute;
    top: 2rem;
    right: 2rem;
    font-size: 3rem;
    text-decoration: none;
    transition: all .2s; }
  .popup__close:hover {
